import React, { useState } from 'react';
import "./styles.css";
import CalendarModal from './Modal';

const Data = () => {
    const [isModalOpen, setModalOpen] = useState(false);

    const handleHireMeClick = () => {
        setModalOpen(true);
    };

    const closeModal = () => {
        setModalOpen(false);
    };

    return (
        <div className="home__data">
            <h1 className='home__title'>
                Hi, I'm Venkatesh Manchala
            </h1>
            <h2 className='home__subtitle'>Full Stack Developer</h2>
            <p className='home__description'>Empowering businesses with innovative solutions and seamless user experiences.</p>
            <button className='button button--flex' onClick={handleHireMeClick}>Hire Me</button>
            {isModalOpen && <CalendarModal closeModal={closeModal} />}
        </div>
    );
}

export default Data;
